import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ITEquipment.css';

const ITEquipment = () => {
  const [itEquipments, setITEquipments] = useState([]);
  const [newEquipment, setNewEquipment] = useState({
    categorie: '',
    marque: '',
    model: '',
    code_materiel: '',
    serie: '',
    code_localisation: '',
    code_entite: '',
    date_installation: '',
    fin_garantie: '',
    statut: '',
    type_acquisition: '',
    date_achat: '',
    date_livraison: '',
    fournisseur: '',
    numero_facture: '',
    prix_achat: '',
    numero_appel_offre: '',
    numero_livraison: '',
    cout_maintenance: '',
    emploi_principal: '',
    niveau_criticite: '',
    sla: '',
    date_sortie: '',
  });

  useEffect(() => {
    const fetchITEquipments = async () => {
      try {
        const response = await axios.get('/it-equipments');
        setITEquipments(response.data);
      } catch (error) {
        console.error('Error fetching IT Equipments:', error);
      }
    };

    fetchITEquipments();
  }, []);

  const handleAddEquipment = async () => {
    try {
      console.log('Adding equipment:', newEquipment);
      const response = await axios.post('/it-equipments', newEquipment);
      console.log('Response from server:', response.data);
      setITEquipments([...itEquipments, response.data]);
      setNewEquipment({
        categorie: '',
        marque: '',
        model: '',
        code_materiel: '',
        serie: '',
        code_localisation: '',
        code_entite: '',
        date_installation: '',
        fin_garantie: '',
        statut: '',
        type_acquisition: '',
        date_achat: '',
        date_livraison: '',
        fournisseur: '',
        numero_facture: '',
        prix_achat: '',
        numero_appel_offre: '',
        numero_livraison: '',
        cout_maintenance: '',
        emploi_principal: '',
        niveau_criticite: '',
        sla: '',
        date_sortie: '',
      });
      console.log('Equipment added successfully');
    } catch (error) {
      console.error('Error adding IT Equipment:', error);
    }
  };

  const handleDeleteEquipment = async (id) => {
    try {
      await axios.delete(`/it-equipments/${id}`);
      setITEquipments(itEquipments.filter(equipment => equipment.id !== id));
    } catch (error) {
      console.error('Error deleting IT Equipment:', error);
    }
  };

  const handleChange = (e) => {
    setNewEquipment({ ...newEquipment, [e.target.name]: e.target.value });
  };

  return (
    <div className="it-equipment-manager">
      <h1>IT Equipment Manager</h1>
      <div className="add-equipment">
        <div className="form-grid">
          {Object.keys(newEquipment).map((key) => (
            <div key={key} className="form-group">
              <label>{key.replace(/_/g, ' ')}</label>
              <input
                type="text"
                name={key}
                value={newEquipment[key]}
                onChange={handleChange}
                placeholder={key.replace(/_/g, ' ')}
              />
            </div>
          ))}
        </div>
        <button onClick={handleAddEquipment}>Add Equipment</button>
      </div>
      <div className="table-container">
        <table className="data-table">
          <thead>
            <tr>
              <th>#</th>
              {Object.keys(newEquipment).map((key) => (
                <th key={key}>{key.replace(/_/g, ' ')}</th>
              ))}
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {itEquipments.map((equipment, index) => (
              <tr key={equipment.id}>
                <td>{index + 1}</td>
                {Object.keys(newEquipment).map((key) => (
                  <td key={key}>{equipment[key]}</td>
                ))}
                <td>
                  <button onClick={() => handleDeleteEquipment(equipment.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ITEquipment;
